import React from 'react'
import 'bootstrap/dist/css/bootstrap.min.css';
// import {Card} from "react-bootstrap";
import "./main.css";



function clickMe(){
  console.log ('you clicked me ');
}



class  Main extends React.Component {
    

    render() {
      return (
        <div className='main'>  
            <div className='card-container'> 
              <div className='card.body'>
                <h1 className='card.title'>
                  Language Activity app
                </h1>
                  <div className='main-text'>
                  <p className='card.text'>
                   Welcome to our website : here, people team up and make activites to learn a language together as a community.  People can meet toether to take an online quiz and meet in real live event
                  </p>
                  </div>
                  div.card
                <button onClick={clickMe} className='register-button'>Click to register</button>
              </div>
            </div>
        </div>
    );
  }
  }
  
  export default Main;
